e duración en videollamada, donde ver:\r\n* Revisión de agenda de actividades de las próximas semanas para la candidata, con ideas de cómo abordarlo en redes, qué mostrar en cada caso y a qué apuntar.\r\n* Ideas de actividades para mostrar en redes\r\n* Ejes de contenido, palabras clave, creación de imagen digital de la candidata\r\n* Manejo de situaciones críticas online, haters, comentarios maliciosos y respuesta a reclamos.\r\n* Respuesta a consultas sobre gestión de redes, análisis de estadísticas y otros datos relevantes para este funcionamiento.\r\n\r\nPrimera sesión en la semana del 24 al 28 de abril, luego cada 15 días, con un total de 4 sesiones.',NULL,'',0.000,0.000,'0',0.000,'0',1,0,0,NULL,519371.00000000,519371.00000000,0.00000000,0.00000000,0.00000000,519371.00000000,1,NULL,NULL,0,0.00000000,NULL,0,1,NULL,NULL,'ARS',519371.00000000,519371.00000000,0.00000000,519371.00000000,NULL),(172,133,NULL,NULL,NULL,'Identidad Diseño de identidad de marca\r\nIncluye:\r\n-Diseño nuevo Iso / Logotipo\r\n-Elementos de marca: elementos gráficos y recursos visuales para utilizar en redes,\r\naudiovisual, etc.\r\n-Guía de uso: Incluye documento digital delineando los principales elementos\r\ngráficos de la marca y explicando cómo deben aplicarse visualmente:\r\narchivos de logo en distintos formatos + tipografías + paleta de colores\r\nIncluye 3 plantillas para que editen en canva.\r\n\r\nSe hacen dos propuestas y sobre una de esas propuestas que elijan , hasta 2 rondas de correcciones\r\n\r\nUna sola asesoría de redes, de hasta 1.5hs de duración en videollamada, donde ver:\r\n* Revisión de agenda de actividades de las próximas semanas para la candidata, con ideas de cómo abordarlo en redes, qué mostrar en cada caso y a qué apuntar.\r\n* Ideas de actividades para mostrar en redes\r\n* Ejes de contenido, palabras clave, creación de imagen digital de la candidata\r\n* Manejo de situaciones críticas online, haters, comentarios maliciosos y respuesta a reclamos.\r\n* Respuest